interface IDEXRouter {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    ) external payable returns (uint256 amountToken, uint256 amountETH, uint256 liquidity);

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

interface IDEXFactory {
    function createPair(address tokenA, address tokenB)
        external
        returns (address pair);
}

contract TORKPAD is ERC20, Ownable {

    IDEXRouter public router;
    mapping(address => bool) public lpPairs;
    mapping(address => bool) public whitelisted;

    address public liquidityWallet = 0x000000000000000000000000000000000000dEaD;
    address public marketingWallet;
    address public nativeStakingPool;
    address public lpStakingPool;
    address public devWallet;

    address public initialLiquidityPair;

    uint256 public buyLiquidityTax = 200;      // 4 decimals. 200 = 2%
    uint256 public buyMarketingTax = 200;
    uint256 public buyNativeStakingTax = 150;
    uint256 public buyLpStakingTax = 50;
    uint256 public buyDevTax = 150;
    uint256 public buyBurnTax = 50;

    uint256 public sellLiquidityTax = 200;      // 4 decimals. 200 = 2%
    uint256 public sellMarketingTax = 200;
    uint256 public sellNativeStakingTax = 150;
    uint256 public sellLpStakingTax = 50;
    uint256 public sellDevTax = 150;
    uint256 public sellBurnTax = 50;

    uint256 public liquidityAccrued;
    uint256 public marketingAccrued;
    uint256 public devAccrued;

    uint256 public swapThreshold;

    bool public inSwap;

    uint256 public constant maxSupply = 100_000_000e18;

    uint256 public maxWallet = maxSupply * 100 / 1e4;

    uint256 public launchTime;

    address public lp_pair;

    modifier taxUnlocked() {
        require(launchTime > 0 && block.timestamp > launchTime + 14 days, "Taxes locked");
        _;
    }

    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    constructor(address _router) ERC20("TorkPad", "TPAD") {
        require(_router != address(0), "ZERO");

        router = IDEXRouter(_router);
        address pair = IDEXFactory(router.factory()).createPair(
            router.WETH(),
            address(this)
        );

        lp_pair = pair;

        _approve(address(this), _router, type(uint256).max);

        lpPairs[pair] = true;
        whitelisted[pair] = true;
        initialLiquidityPair = pair;
        whitelisted[_msgSender()] = true;
        _mint(_msgSender(), maxSupply);
        swapThreshold = maxSupply / 5000;
        whitelisted[address(this)] = true;
    }

    // percent in 4 decimals. 100 = 1%
    function setMaxWallet(uint256 _maxWalletPercent) external onlyOwner {
        require(_maxWalletPercent >= 10 && _maxWalletPercent <= 100, "Max wallet between 0.1% to 1%");
        maxWallet = maxSupply * _maxWalletPercent / 1e4;
    }

    function setTaxWallets(address _marketingWallet, address _devWallet) external onlyOwner {
        require(!isContract(_marketingWallet) && !isContract(_devWallet), "BNB receving wallets cannot be contracts");
        marketingWallet = _marketingWallet;
        devWallet = _devWallet;
        whitelisted[marketingWallet] = true;
        whitelisted[devWallet] = true;
    }

    function setStakingPools(address _nativeStakingPool, address _lpStakingPool) external onlyOwner {
        require(_nativeStakingPool != address(0), "Native staking pool cannot be zero address");
        require(_lpStakingPool != address(0), "LP staking pool cannot be zero address");
        nativeStakingPool = _nativeStakingPool;
        lpStakingPool = _lpStakingPool;
        whitelisted[nativeStakingPool] = true;
        whitelisted[lpStakingPool] = true;
    }

    function setLiquidityPair(address _lp, bool _status) external onlyOwner {
        lpPairs[_lp] = _status;
        whitelisted[_lp] = true;
        lp_pair = _lp;
    }

    function setWhitelisted(address _address, bool _status) external onlyOwner {
        require(_address != initialLiquidityPair, "Initial liquidity pair cannot be removed from the whitelist");
        whitelisted[_address] = _status;
    }

    function setLiquidityTax(uint256 _buyLiquidityTax, uint256 _sellLiquidityTax) external taxUnlocked onlyOwner {
        buyLiquidityTax = _buyLiquidityTax;
        sellLiquidityTax = _sellLiquidityTax;
        checkMaxTax();
    }

    function setMarketingTax(uint256 _buyMarketingTax, uint256 _sellMarketingTax) external taxUnlocked onlyOwner {
        buyMarketingTax = _buyMarketingTax;
        sellMarketingTax = _sellMarketingTax;
        checkMaxTax();
    }

    function setNativeStakingTax(uint256 _buyNativeStakingTax, uint256 _sellNativeStakingTax) external taxUnlocked onlyOwner {
        buyNativeStakingTax = _buyNativeStakingTax;
        sellNativeStakingTax = _sellNativeStakingTax;
        checkMaxTax();
    }

    function setLpStakingTax(uint256 _buyLpStakingTax, uint256 _sellLpStakingTax) external taxUnlocked onlyOwner {
        buyLpStakingTax = _buyLpStakingTax;
        sellLpStakingTax = _sellLpStakingTax;
        checkMaxTax();
    }

    function setDevTax(uint256 _buyDevTax, uint256 _sellDevTax) external taxUnlocked onlyOwner {
        buyDevTax = _buyDevTax;
        sellDevTax = _sellDevTax;
        checkMaxTax();
    }

    function setBurnTax(uint256 _buyBurnTax, uint256 _sellBurnTax) external taxUnlocked onlyOwner {
        buyBurnTax = _buyBurnTax;
        sellBurnTax = _sellBurnTax;
        checkMaxTax();
    }

    function setSwapThreshold(uint256 _swapThreshold) external onlyOwner {
        require(_swapThreshold > totalSupply() / 1000000, "SwapThreshold must be greater than 0.0001% of total supply");
        swapThreshold = _swapThreshold;
    }

    function totalBuyTax() internal view returns (uint256) {
        return buyLiquidityTax + buyMarketingTax + buyNativeStakingTax + buyLpStakingTax + buyDevTax + buyBurnTax;
    }

    function totalSellTax() internal view returns (uint256) {
        return sellLiquidityTax + sellMarketingTax + sellNativeStakingTax + sellLpStakingTax + sellDevTax + sellBurnTax;
    }

    function checkMaxTax() internal view {
        require(totalBuyTax() <= 1000, "Buy Tax > 10%");
        require(totalSellTax() <= 1000, "Sell Tax > 10%");
    }

    function burn(uint256 amount) external {
        _burn(msg.sender, amount);
    }

    function transferFrom(address from, address to, uint256 amount) public override returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transferFrom(from, to, amount);
        return true;
    }

    function transfer(address to, uint256 amount) public override returns (bool) {
        address owner = _msgSender();
        _transferFrom(owner, to, amount);
        return true;
    }

    function swapBack() internal swapping {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = router.WETH();

        uint256 contractBalance = balanceOf(address(this));
        uint256 swapAccrued = liquidityAccrued + marketingAccrued + devAccrued;
        uint256 liquidityAmount = contractBalance * liquidityAccrued / swapAccrued;
        uint256 marketingAmount = contractBalance * marketingAccrued / swapAccrued;
        uint256 devAmount = contractBalance * devAccrued / swapAccrued;
        uint256 convertAmount = contractBalance - (liquidityAmount / 2);

        uint256 ethBefore = address(this).balance;
        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            convertAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
        uint256 amountEth = address(this).balance - ethBefore;
        safeTransferBNB(marketingWallet, amountEth * marketingAmount / convertAmount);
        safeTransferBNB(devWallet, amountEth * devAmount / convertAmount);

        router.addLiquidityETH{value: address(this).balance}(
            address(this),
            balanceOf(address(this)),
            0,
            0,
            liquidityWallet,
            block.timestamp
        );

        liquidityAccrued = 0;
        marketingAccrued = 0;
        devAccrued = 0;
    }

    function _transferFrom(address from, address to, uint256 amount) internal {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        
        if ((from == lp_pair && !whitelisted[to]) || (!whitelisted[to] && !whitelisted[from])) {
            require(balanceOf(to) + amount <= maxWallet, "Max wallet reached");
        }

        if (launchTime == 0 && lpPairs[to]) {
            launchTime = block.timestamp;
        }

        if (lpPairs[from] || lpPairs[to]) {
            if (lpPairs[to] && !whitelisted[from] && from != address(this)) {
                // Sell tax
                uint256 liquidityTax = sellLiquidityTax * amount / 1e4;
                uint256 marketingTax = sellMarketingTax * amount / 1e4;
                uint256 devTax = sellDevTax * amount / 1e4;
                liquidityAccrued += liquidityTax;
                marketingAccrued += marketingTax;
                devAccrued += devTax;
                _transfer(from, address(this), liquidityTax + marketingTax + devTax);
                uint256 contractBalance = balanceOf(address(this));
                if (contractBalance > swapThreshold && liquidityAccrued + marketingAccrued + devAccrued > 0 && !inSwap) {
                    swapBack();
                }
                uint256 nativeStakingTax = sellNativeStakingTax * amount / 1e4;
                _transfer(from, nativeStakingPool, nativeStakingTax);
                uint256 lpStakingTax = sellLpStakingTax * amount / 1e4;
                _transfer(from, lpStakingPool, lpStakingTax);
                uint256 burnTax = sellBurnTax * amount / 1e4;
                _burn(from, burnTax);
                amount = amount - (liquidityTax + marketingTax + devTax + nativeStakingTax + lpStakingTax + burnTax);

            } else if (lpPairs[from] && !whitelisted[to] && to != address(this)) {
                // Buy Tax
                uint256 liquidityTax = buyLiquidityTax * amount / 1e4;
                uint256 marketingTax = buyMarketingTax * amount / 1e4;
                uint256 devTax = buyDevTax * amount / 1e4;
                liquidityAccrued += liquidityTax;
                marketingAccrued += marketingTax;
                devAccrued += devTax;
                _transfer(from, address(this), liquidityTax + marketingTax + devTax);
                uint256 nativeStakingTax = buyNativeStakingTax * amount / 1e4;
                _transfer(from, nativeStakingPool, nativeStakingTax);
                uint256 lpStakingTax = buyLpStakingTax * amount / 1e4;
                _transfer(from, lpStakingPool, lpStakingTax);
                uint256 burnTax = buyBurnTax * amount / 1e4;
                _burn(from, burnTax);
                amount = amount - (liquidityTax + marketingTax + devTax + nativeStakingTax + lpStakingTax + burnTax);
            }
        }

        _transfer(from, to, amount);
    }

    function isContract(address account) internal view returns (bool) {
        return account.code.length > 0;
    }

    function withdrawStuckBalance(address recipient) external onlyOwner {
        uint256 amountBNB = address(this).balance;
        safeTransferBNB(recipient, amountBNB);
    }

    function safeTransferBNB(address to, uint256 value) internal {
        (bool success, ) = to.call{value: value}(new bytes(0));
        require(success, 'STE');
    }


    function recoverWrongTokens(address _tokenAddress) external onlyOwner {
       require(_tokenAddress != address(this), "Cannot be native token");
       uint256 _tokenAmount = IERC20(_tokenAddress).balanceOf(address(this));
       IERC20(_tokenAddress).transfer(address(msg.sender), _tokenAmount);
    }




    receive() external payable {}
}
